package main

import (
	"fmt"
	"sync"
	"time"
)

type ResourceUpdate struct {
	Type       string
	Identifier string
	Value      float64
}

type Monitor struct {
	configMutex      sync.RWMutex
	allowedTypes     map[string]bool
	dataMutex        sync.Mutex
	data             map[string]map[string]float64
	highPriorityQueue chan ResourceUpdate
	lowPriorityQueue  chan ResourceUpdate
	wg               sync.WaitGroup
}

func NewMonitor(initialTypes []string) *Monitor {
	m := &Monitor{
		allowedTypes:      make(map[string]bool),
		data:              make(map[string]map[string]float64),
		highPriorityQueue: make(chan ResourceUpdate, 100),
		lowPriorityQueue:  make(chan ResourceUpdate, 100),
	}
	m.Reconfigure(initialTypes)
	return m
}

func (m *Monitor) Start() {
	for i := 0; i < 5; i++ {
		m.wg.Add(1)
		go m.worker(m.highPriorityQueue)
	}
	for i := 0; i < 5; i++ {
		m.wg.Add(1)
		go m.worker(m.lowPriorityQueue)
	}
}

func (m *Monitor) worker(queue <-chan ResourceUpdate) {
	defer m.wg.Done()
	for update := range queue {
		m.configMutex.RLock()
		allowed := m.allowedTypes[update.Type]
		m.configMutex.RUnlock()

		if !allowed {
			continue
		}

		m.dataMutex.Lock()
		if _, exists := m.data[update.Type]; !exists {
			m.data[update.Type] = make(map[string]float64)
		}
		m.data[update.Type][update.Identifier] = update.Value
		m.dataMutex.Unlock()
	}
}

func (m *Monitor) Reconfigure(types []string) {
	m.configMutex.Lock()
	defer m.configMutex.Unlock()
	m.allowedTypes = make(map[string]bool)
	for _, t := range types {
		m.allowedTypes[t] = true
	}
}

func (m *Monitor) SubmitHighPriority(update ResourceUpdate) {
	m.highPriorityQueue <- update
}

func (m *Monitor) SubmitLowPriority(update ResourceUpdate) {
	m.lowPriorityQueue <- update
}

func (m *Monitor) Shutdown() {
	close(m.highPriorityQueue)
	close(m.lowPriorityQueue)
	m.wg.Wait()
}

func main() {
	monitor := NewMonitor([]string{"CPU", "Memory"})
	monitor.Start()

	monitor.SubmitHighPriority(ResourceUpdate{"CPU", "server1", 50.0})
	monitor.SubmitLowPriority(ResourceUpdate{"Memory", "server1", 30.0})
	monitor.SubmitHighPriority(ResourceUpdate{"Disk", "server1", 100.0})

	time.Sleep(100 * time.Millisecond)

	monitor.Reconfigure([]string{"CPU", "Memory", "Disk"})

	monitor.SubmitHighPriority(ResourceUpdate{"Disk", "server1", 100.0})
	monitor.SubmitLowPriority(ResourceUpdate{"Network", "server1", 5.0})
	monitor.SubmitHighPriority(ResourceUpdate{"CPU", "server2", 75.0})

	time.Sleep(100 * time.Millisecond)

	monitor.Shutdown()

	monitor.dataMutex.Lock()
	fmt.Println("Resource Data:")
	for resType, resources := range monitor.data {
		for id, value := range resources {
			fmt.Printf("%s %s: %.2f\n", resType, id, value)
		}
	}
	monitor.dataMutex.Unlock()
}
